CREATE DEFINER=`root`@`localhost` PROCEDURE `org_cart` (IN `Action` VARCHAR(20), IN `CustomerId` INT(10), IN `BookId` INT(10), IN `total` INT(10), IN `oide` INT(10), IN `qan` INT(10), IN `tid` INT(10))  BEGIN
DECLARE
odate DATE;
DECLARE
flag INT;
    SET
        odate = NOW();
    SET
        flag=0;
 IF ACTION = 'DELETE' then
    BEGIN
    DELETE
FROM
    ord_summar
WHERE
    bid = BookId && oid = '00';
END ;
END IF;
    IF Action = 'INSERT' then
    BEGIN
        SELECT COUNT(*) INTO flag
        from ord_summar 
        where bid=Bookid && oid='00';
        
        IF flag >0 then
        UPDATE ord_summar SET Quant=Quant+qan
        WHERE bid=Bookid && oid='00';
        ELSE
        INSERT INTO ord_summar(oid,cid,bid,Quant,odate)
    VALUES('00', CustomerId, Bookid,qan,odate);
   END IF;

END; 
END IF;
    IF Action = 'FINAL' then
BEGIN
    INSERT INTO orderplaced(cid, amount,orderdate,transid)
	VALUES(CustomerId, total,odate,tid); 
SELECT oid into oide
FROM
    orderplaced
WHERE
    cid = CustomerId && transid=tid && amount=amount;
UPDATE
    ord_summar
SET
    oid = oide
WHERE
    cid = CustomerId && oid='00';

UPDATE
    books s JOIN ord_summar r on s.bookid=r.bid && r.oid=oide
SET
    s.Quantity =(s.Quantity -r.Quant);

END; 
END IF;
IF Action = 'EMPTY' then
BEGIN
    DELETE
FROM
    ord_summar
WHERE
    cid = CustomerId && oid = '00';
END;
END IF;
END$$

DELIMITER ;

